import { Route } from 'react-router-dom';
// import Login from /components/Login';
import Login from './components/Login';
import Users from './Users';

const App = () => {
  return (
    <div>
      <Route exact path="/" component={Login} />
      <Route path="/users" component={Users} />
    </div>
  );
};

export default App;
